public class BuddyStrings {
    public boolean buddyStrings(String s, String goal) {
        if(s.equals(goal)) {
            for(int i = 0; i < s.length()-1; i++){
                for(int j = i+1; j < s.length(); j++){
                    if(s.charAt(i) == s.charAt(j)) return true;
                }
            }
            return false;
        }
        StringBuilder a = new StringBuilder(s);
        int firstIndex = -1, secondIndex = 0;
        for(int i = 0; i < s.length(); i++){
            if(s.charAt(i) != goal.charAt(i)){
                if(firstIndex == -1)
                    firstIndex = i;
                else secondIndex = i;
            }
        }
        char c = a.charAt(secondIndex);
        a.setCharAt(secondIndex, a.charAt(firstIndex));
        a.setCharAt(firstIndex, c);
        return goal.equals(a.toString());
    }

    public static void main(String[] args) {
        BuddyStrings b = new BuddyStrings();
        System.out.println(b.buddyStrings("ab","ab"));
//        System.out.println(b.buddyStrings("",
//                ""));
    }
}
